import React, { useState } from "react"

const Register = () => {
  const [value, setValue] = useState({
    name: "",
    email: "",
    age: "",
    mobile: "",
    work: "",
    add: "",
    desc: "",
  })

  const setdata = (e) => {
    const { name, value } = e.target
    setValue((preval) => {
      return {
        ...preval,
        [name]: value,
      }
    })
  }

  const addUser = async (e) => {
    console.log("clicked")
    // e.prevent.default()
    // const { name, email, age, mobile, work, add, desc } = value
    // const res = await fetch("http://localhost:8003/register", {
    //   method: "POST",
    //   headers: {
    //     "Content-Type": "application/json",
    //   },
    //   body: JSON.stringify({
    //     name,
    //     email,
    //     age,
    //     mobile,
    //     work,
    //     add,
    //     desc,
    //   }),
    // })
    // const data = await res.json()
    // console.log(data)
    // if (res.status === 422 || !data) {
    //   alert("error")
    //   console.log("error")
    // } else {
    //   alert("data added")
    //   console.log("data added")
    // }
  }

  return (
    <div className="container mt-5">
      <form className=" row g-3" onSubmit={addUser}>
        <div className="mb-3 col-lg-6 col-md-6 col-12">
          <label htmlFor="inputEmail4" className="form-label">
            Name
          </label>
          <input
            type="text"
            className="form-control"
            name="name"
            value={value.name}
            id="inputEmail4"
            onChange={setdata}
          />
        </div>
        <div className="mb-3 col-lg-6 col-md-6 col-12">
          <label htmlFor="inputPassword4" className="form-label">
            Email
          </label>
          <input
            type="email"
            className="form-control"
            name="email"
            value={value.email}
            onChange={setdata}
            id="inputPassword4"
          />
        </div>
        <div className="mb-3 col-lg-6 col-md-6 col-12">
          <label htmlFor="inputPassword4" className="form-label">
            Age
          </label>
          <input
            type="number"
            className="form-control"
            name="age"
            value={value.age}
            onChange={setdata}
            id="inputPassword4"
          />
        </div>
        <div className="mb-3 col-lg-6 col-md-6 col-12">
          <label htmlFor="inputPassword4" className="form-label">
            Mobile
          </label>
          <input
            type="number"
            className="form-control"
            name="mobile"
            value={value.number}
            onChange={setdata}
            id="inputPassword4"
          />
        </div>
        <div className="mb-3 col-lg-6 col-md-6 col-12">
          <label htmlFor="inputPassword4" className="form-label">
            Work
          </label>
          <input
            type="text"
            className="form-control"
            name="work"
            value={value.work}
            onChange={setdata}
            id="inputPassword4"
          />
        </div>
        <div className="mb-3 col-lg-6 col-md-6 col-12">
          <label htmlFor="inputPassword4" className="form-label">
            Address
          </label>
          <input
            type="text"
            className="form-control"
            name="add"
            value={value.add}
            onChange={setdata}
            id="inputPassword4"
          />
        </div>
        <div className="col-md-6 col-lg-12 col-12">
          <label htmlFor="inputPassword4" className="form-label">
            Description
          </label>
          <textarea
            type="text"
            className="form-control"
            cols="30"
            name="desc"
            value={value.desc}
            onChange={setdata}
            rows="5"
            id="inputPassword4"
          />
        </div>
      </form>
      <div className="col-12">
        <button type="submit" className="btn btn-primary">
          Add
        </button>
      </div>
    </div>
  )
}

export default Register
